import React from 'react';
import FaustoBuilding from '../images/fausto_building.jpg'

function Lincolnton(){
    return (
        <div className="bg-yellow-100">
            <div className="grid grid-cols-2">
                <img className="object-cover h-56 w-auto" src="https://charlotteaxios-charlotteagenda.netdna-ssl.com/wp-content/uploads/2016/12/Fausto-Coffee-Lincolnton.jpg" alt="" />
                <div className="bg-yellow-500 font-serif grid place-items-center p-2 text-3xl text-center text-white">
                    <h1>Where are we?</h1>
                </div>
                <div className="bg-yellow-700 font-serif grid place-items-center p-2 text-2xl text-center text-white">
                    <h1>116 N.E. Court Square, Lincolnton, NC 28092</h1>
                </div>
                <img className="object-cover h-56 w-auto" src="https://s3-media0.fl.yelpcdn.com/bphoto/ByrulVNYy9nNg4P8Q8ZhEg/l.jpg" alt="" />
            </div>
        </div>
    );
}

export default Lincolnton;
